      SELECT ALL + - CAST ( NULL AS INTEGER ) + - col0 FROM tab2 (FORMAT parquet) WHERE + + CAST ( NULL AS REAL ) / + col1 BETWEEN - col0 AND - col1 / - col2 + + 48;
  - name: tab2

outputs:
  - name: q10603.out
    data: |
